import React, { useState } from 'react'
import { Modal, Button } from 'react-bootstrap'
import { faTrash } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import CustomToast from './CustomToast'

function DeleteModal(props) {

    const [disableButton, setDisableButton] = useState(false);
    const [showToast, setShowToast] = useState(false);
    const [success, setSuccess] = useState(true);
    const [toastMessage, setToastMessage] = useState("");

    const handleSubmit = () => {

    }

    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered
        >
            <Modal.Header closeButton>
                <Modal.Title id="contained-modal-title-vcenter">
                    Confirmation
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                <p>Are you sure you want to delete the photo '{ }'</p>
            </Modal.Body>
            <Modal.Footer>
                <Button type="submit" variant="success" onClick={handleSubmit} disabled={disableButton}>
                    <FontAwesomeIcon icon={faTrash} /> {disableButton ? 'Please wait...' : 'Share'}
                </Button>
            </Modal.Footer>
            <div style={{ "display": showToast ? "block" : "none" }}>
                <CustomToast success={success} message={toastMessage} />
            </div>
        </Modal>
    )
}

export default DeleteModal
